// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Auction {
    address public owner;
    address public highestBidder;
    uint256 public highestBid;
    uint256 public auctionEndTime;
    uint256 public constant commissionRate = 2; // 2% commission

    struct Bid {
        address bidder;
        uint256 amount;
    }

    Bid[] public bids; // Array to store all bids

    mapping(address => uint256) public balances; // Balance of each participant

    // Events
    event BidPlaced(address indexed bidder, uint256 amount);
    event WinnerDeclared(address indexed winner, uint256 amount);
    event DepositRefunded(address indexed bidder, uint256 amount);
    event AuctionExtended(uint256 newEndTime);

    // Modifier to restrict access to the owner
    modifier onlyOwner() {
        require(msg.sender == owner, "Access denied: Not the owner");
        _;
    }

    // Modifier to ensure the auction is still active
    modifier auctionActive() {
        require(block.timestamp < auctionEndTime, "The auction has ended");
        _;
    }

    // Constructor to initialize the auction with a duration
    constructor(uint256 auctionDuration) {
        owner = msg.sender;
        auctionEndTime = block.timestamp + auctionDuration;
    }

    // Function to place a bid
    function placeBid() external payable auctionActive {
        require(msg.value > highestBid * 105 / 100, "Bid must exceed current bid by at least 5%");

        // Record any excess in the bidder's balance
        if (balances[msg.sender] > 0) {
            balances[msg.sender] += msg.value - highestBid;
        } else {
            balances[msg.sender] = msg.value;
        }

        // Update highest bid
        highestBid = msg.value;
        highestBidder = msg.sender;

        // Add bid to the list
        bids.push(Bid(msg.sender, msg.value));

        // Extend time if less than 10 minutes remain
        if (block.timestamp > auctionEndTime - 10 minutes) {
            auctionEndTime += 10 minutes;
            emit AuctionExtended(auctionEndTime);
        }

        emit BidPlaced(msg.sender, msg.value);
    }

    // Function to show the current winner and the highest bid
    function showWinner() external view returns (address, uint256) {
        return (highestBidder, highestBid);
    }

    // Function to show all bids and their amounts
    function showBids() external view returns (Bid[] memory) {
        return bids;
    }

    // Function for the owner to return deposits to non-winners with a 2% commission
    function refundDeposits() external onlyOwner {
        require(block.timestamp >= auctionEndTime, "Auction is still active");

        for (uint256 i = 0; i < bids.length; i++) {
            address bidder = bids[i].bidder;
            if (bidder != highestBidder) {
                uint256 refundAmount = (balances[bidder] * (100 - commissionRate)) / 100;
                balances[bidder] = 0;
                payable(bidder).transfer(refundAmount);
                emit DepositRefunded(bidder, refundAmount);
            }
        }
    }

    // Function for participants to withdraw excess from their last bid
    function partialRefund() external {
        uint256 userBalance = balances[msg.sender];

        // Check if the user has any excess over the highest bid
        require(userBalance > highestBid, "No excess to withdraw");

        uint256 excess = userBalance - highestBid;

        // Update the user's balance and transfer the excess
        balances[msg.sender] -= excess;
        payable(msg.sender).transfer(excess);
    }

    // Function for the owner to end the auction and declare the winner
    function endAuction() external onlyOwner {
        require(block.timestamp >= auctionEndTime, "Auction is still active");
        emit WinnerDeclared(highestBidder, highestBid);
    }
}

